import React from 'react';
import Heading from './components/Heading/Heading';

const Portfolio = () => {
   

  return (
    <>
     <section className='gallery-sec-wrp'>
        <div className='container'>
          <div className='row'>
            <div className='col-12'>
              <Heading title='my portfolio' />
            </div>
          </div>
        </div>
     </section>
    </>
  )
}
export default Portfolio;
